class Solution:
    def XSum(self, candidates, target, size):
        results = []
        if size == 0 or len(candidates) < size:
            return results
        if len(candidates) == size:
            if sum(candidates) == target:
                return [candidates]
            return results
        for index, candidate in enumerate(candidates):
            if size == 1:
                if candidate == target and candidate not in results:
                    results.append([candidate])
                if candidate > target:
                    break
                continue
            for sub_candidate in self.XSum(candidates[index + 1:], target - candidate, size - 1):
                current_list = [candidate] + sub_candidate
                if current_list not in results:
                    results.append(current_list)
        return results
    def fourSum(self, nums: list, target: int) -> list:
        nums.sort()
        return self.XSum(nums, target, 4)

